import React from "react";
import name,{name2,get} from "./New";

function Demo() {

    <>
    <ul>
    <li>name is : {name}</li>
    <li>the Addition  of two number is {get()}</li>
    <li>second name is : {name2}</li>
    <li></li>


    </ul>
    
    </>
}
export default Demo;
